It‚Äôs funny when you think of New York iconic images, you think yellow taxis, skyscrapers, Times Square‚Äôs LED billboards at night, and steam coming out from manhole covers on the sidewalk.

Something about the steam screams NEW YORK CITY. 
In the daytime, steam reminds you of the heat and energy of a buzzing metropolis. Late at night, on a quiet street, there is something romantic about it.

Underneath the streets of Manhattan, there are more than¬†100 miles¬†of service pipes bringing steam to about 1,800 buildings. Steam may seem like a primitive source of energy (think of steamboats and steam engines - we don‚Äôt see those anymore). 
But when New York‚Äôs first power plant opened in 1882, steam from clean water greatly reduced the amount of soot created by individual coal-burning furnaces which were the primary source of heat at the time.¬†

Steam is an environmentally friendly source of energy and besides the obvious reasons (to heat and cool buildings), steam also plays a role in the sanitization of hospital equipment, the dry-cleaning industry, and believe it or not, the humidification process for priceless works of art in the city‚Äôs finest museums such as the Metropolitan Museum of Art.¬†

